import React from "react";
import './result.scss';



export default function Results(data,updateBody) {
  return (
    <section className="result">
      <pre>
        {data ? JSON.stringify(data, undefined, 2) : null}
      </pre>
      <pre>
      {updateBody ? JSON.stringify(data.Results, undefined, 2) : null}

      </pre>
    </section>
  );
}
